q&sz=w200-h190"},{"id":"13oidgYNOYKCj-3QNwEth7OGDGb_1Sm1d","name":"9S7A6468.jpg","download":"https://drive.usercontent.google.com/download?id=13oidgYNOYKCj-3QNwEth7OGDGb_1Sm1d&export=download","thumb":"https://drive.google.com/thumbnail?id=13oidgYNOYKCj-3QNwEth7OGDGb_1Sm1d&sz=w200-h190"},{"id":"1bUPBIaSvLIQ2WiHLkzAlWYMMC9vuuPvG","name":"9S7A6469.jpg","download":"https://drive.usercontent.google.com/download?id=1bUPBIaSvLIQ2WiHLkzAlWYMMC9vuuPvG&export=download","thumb":"https://drive.google.com/thumbnail?id=1bUPBIaSvLIQ2WiHLkzAlWYMMC9vuuPvG&sz=w200-h190"}];const PAGE_SIZE = 120;let filtered = ITEMS;let page = 1;const selected = new Set();function applyFilter(){  const q = document.getElementById("q").value.trim().toLowerCase();  filtered = q ? ITEMS.filter(x => x.name.toLowerCase().includes(q)) : ITEMS;  page = 1;  render();}function setPage(p){ page = p; render(); }function toggleSelect(id, checked){  if(checked) selected.add(id); else selected.delete(id);  updateMeta();}function selectAll(v){  const start = (page-1)*PAGE_SIZE;  const end = Math.min(start + PAGE_SIZE, filtered.length);  for(let i=start;i<end;i++){    const id = filtered[i].id;    if(v) selected.add(id); else selected.delete(id);  }  render(false);  updateMeta();}function clearSelected(){  selected.clear();  render(false);  updateMeta();}function openSelected(){  const arr = Array.from(selected);  if(!arr.length){ alert("Chưa chọn ảnh nào"); return; }  const map = new Map(ITEMS.map(x=>[x.id,x]));  arr.forEach((id,i)=>{    const it = map.get(id); if(!it) return;    setTimeout(()=>{ window.open(it.download, "_blank", "noopener"); }, i*250);  });}function render(updatePager=true){  const g = document.getElementById("gallery");  g.innerHTML = "";  const totalPages = Math.max(1, Math.ceil(filtered.length / PAGE_SIZE));  page = Math.min(page, totalPages);  const start = (page-1)*PAGE_SIZE;  const end = Math.min(start + PAGE_SIZE, filtered.length);  for(let i=start;i<end;i++){    const it = filtered[i];    const div = document.createElement("div");    div.className = "item";    const cb = document.createElement("input");    cb.type = "checkbox";    cb.checked = selected.has(it.id);    cb.onchange = () => toggleSelect(it.id, cb.checked);    const label = document.createElement("label");    label.appendChild(cb);    label.appendChild(document.createTextNode(" Select"));    const br = document.createElement("br");    const a = document.createElement("a");    a.href = it.download;    a.target = "_blank";    a.rel = "noopener";    const img = document.createElement("img");    img.className = "thumb";    img.loading = "lazy";    img.src = it.thumb;    img.alt = it.name;    a.appendChild(img);    const name = document.createElement("div");    name.className = "name";    name.textContent = it.name;    div.appendChild(label);    div.appendChild(br);    div.appendChild(a);    div.appendChild(name);    g.appendChild(div);  }  if(updatePager) renderPager(totalPages);  updateMeta(totalPages);}function renderPager(totalPages){  const p = document.getElementById("pager");  p.innerHTML = "";  const make = (label, to, active=false) => {    const s=document.createElement("span");    s.className="pill"+(active?" active":"");    s.textContent=label;    s.onclick=()=>setPage(to);    return s;  };  p.appendChild(make("« Prev", Math.max(1, page-1)));  const windowSize = 7;  let a = Math.max(1, page - Math.floor(windowSize/2));  let b = Math.min(totalPages, a + windowSize - 1);  a = Math.max(1, b - windowSize + 1);  for(let i=a;i<=b;i++){    p.appendChild(make(String(i), i, i===page));  }  p.appendChild(make("Next »", Math.min(totalPages, page+1)));}function updateMeta(totalPages){  const m = document.getElementById("meta");  const tp = totalPages ?? Math.max(1, Math.ceil(filtered.length / PAGE_SIZE));  m.textContent = `Total: ${ITEMS.length} | Showing: ${filtered.length} | Page: ${page}/${tp} | Selected: ${selected.size}`;}document.getElementById("q").addEventListener("input", ()=>{  clearTimeout(window.__t); window.__t=setTimeout(applyFilter, 150);});render();</script></body></html>
